int srovnej (int a, int b){
if (a>b) return 1;
else return 0;	
}

int srovnej2(int a, int b){
if (a<b) return 1;
else return 0;	
}

void vymen(int *a, int *b){
int pom;
pom=*a; *a=*b; *b=pom;
}

void bubble(int p[], int n, int (*pf1) (),void (*pf2())){
int i,j;
for (i=1; i<n; i++)
for (j=n-1; j>=i; j--)
if (pf1(p[j-1],p[j]))  // provede se vymena
pf2(&p[j-1],&p[j]); // lze i (*pf2) (&p[j-1], &p[j]);	
}

